def equilibrium_point(numbers, size):

    if size == 1:
        return 1
    i = 0
    j = size - 1
    left_sum = 0
    right_sum = 0
    while i < j:
        if left_sum < right_sum:
            left_sum += numbers[i]
            i += 1
        else:
            right_sum += numbers[j]
            j -= 1
    if left_sum == right_sum:
        return i + 1
    else:
        return -1

