import torch

def smooth_l1_loss(input, target, beta=1.0, reduction='mean'):

    assert reduction in ['mean', 'none']
    n = torch.abs(input - target)
    cond = n < beta
    loss = torch.where(cond, 0.5 * n ** 2 / beta, n - 0.5 * beta)
    if reduction == 'mean':
        return loss.mean()
    return loss.sum()

