import numpy

def coordinates2(N):


    N2 = N // 2
    if N % 2 == 0:
        return numpy.mgrid[-N2:N2, -N2:N2][::-1] / N
    else:
        return numpy.mgrid[-N2:N2+1, -N2:N2+1][::-1] / N

