def convert_size(value, in_format, out_format):

    result = int()
    if in_format == "BLK":
        if out_format == "MB":
            result = int(value) >> 10
        if out_format == "GB":
            result = int(value) >> 20
    elif in_format == "MB":
        if out_format == "BLK":
            result = int(value) << 10
        if out_format == "GB":
            result = int(value) >> 10
    elif in_format == "GB":
        if out_format == "BLK":
            result = int(value) << 20
        if out_format == "MB":
            result = int(value) << 10
    return result

