def HUEtoNCOL(H):


    if H == -1.0:
        return "R0"

    H %= 360

    if H < 60:
        return "R" + str(int(H / 0.6))
    elif H < 120:
        return "Y" + str(int((H - 60) / 0.6))
    elif H < 180:
        return "G" + str(int((H - 120) / 0.6))
    elif H < 240:
        return "C" + str(int((H - 180) / 0.6))
    elif H < 300:
        return "B" + str(int((H - 240) / 0.6))
    elif H < 360:
        return "M" + str(int((H - 300) / 0.6))

