def get_stamp(qcval, quartiles):

    stamp = 'N'

    if qcval is not None:
        if qcval > quartiles[75]:
            stamp = 'A'
        elif quartiles[75] >= qcval > quartiles[50]:
            stamp = 'B'
        elif quartiles[50] >= qcval > quartiles[25]:
