def check_monotonic(a):

    len_a = len(a)
    assert len_a > 0

    last = a[0]
    i = 1
    while i < len_a and a[0] == a[i]:
        i += 1

    if i == len_a:
        return 1

    next = a[i]
    i += 1
    if last < next:
        while i < len_a:
            last = next
            next = a[i]
            if last > next:
                return 0
            i += 1
        return 1
    else:
        while i < len_a:
            last = next
            next = a[i]
            if last < next:
                return 0
            i += 1
        return -1

def best_range(A, target):

    if len(A) == 0:
        return None
    lo = 0
    hi = len(A)-1

    while lo <= hi:
        mid = (lo + hi) // 2

        if target < A[mid]:
            hi = mid-1
        elif target > A[mid]:
            lo = mid+1
        else:
            break

    if lo > hi:
        return None

    # find left-edge of range. This time use < to exit loop when on final one
    left_hi = mid - 1
    while lo < left_hi:
        m = (lo + left_hi) // 2

        if target == A[m]:     # keep going to the left
            left_hi = m-1
        else:
            lo = m + 1

    if A[lo] != target:
        lo += 1

    # find right-edge of range. This time use < to exit loop when on final one
    right = mid + 1
    while right < hi:
        m = (right + hi) // 2

        if target == A[m]:     # keep going to the right
            right = m+1
        else:
            hi = m - 1

    if right == len(A) or A[right] != target:
        right -= 1

    return (lo, right)

def max_value(tab):


    maxValue=0
