def make_freq_table(fs, N):

    assert(N % 2 == 0)

    if N == 0:
        return numpy.array([])
    else:
        delta_f = fs / float(N)
        f = lambda i: delta_f * (min(i, N - 1 - i) + 0.5)

        return numpy.fromfunction(numpy.vectorize(f), [N], dtype=numpy.int32)

