def compute_dice_binary(m1, m2, eps=1e-8):

    if m1.sum() == 0 and m2.sum() == 0:
        return 1

    a = (m1 * m2).sum().add(eps)
    b = (m1.sum() + m2.sum()).add(eps)

    result = a.mul(2).div(b)

